import React, { useEffect, useState } from 'react';
import { useMovieList } from '../hooks/controller';
import "../style/"

const EditMovie = () => {
    const [title, setTitle] = useState('');
    const [genre, setGenre] = useState('');
    const [duration, setDuration] = useState('');
    const [language, setLanguage] = useState('');
    const [releaseDate, setReleaseDate] = useState('');
    const [rating, setRating] = useState('');
    const [theatre, setTheatre] = useState('');

    const { movies, editMovie, updateMovie } = useMovieList();

    const handleEditMovie = () => {
        const movieData = { title, genre, duration, language, releaseDate, rating, theatre };
        updateMovie(movieData);
    };

    useEffect(() => {
        if (editMovie) {
            setTitle(editMovie?.title || '');
            setGenre(editMovie?.genre || '');
            setDuration(editMovie?.duration || '');
            setLanguage(editMovie?.language || '');
            setReleaseDate(editMovie?.releaseDate || '');
            setRating(editMovie?.rating || '');
            setTheatre(editMovie?.theatre || '');
        }
    }, [editMovie]);

    return (
        <div className="editMovie">
            <h2 className="admin-title">Edit Movie</h2>

            {/* Movie Editing Form */}
            <div className="movieForm">
                <label>Title:</label>
                <input type="text" value={title} onChange={(e) => setTitle(e.target.value)} />

                <label>Genre:</label>
                <input type="text" value={genre} onChange={(e) => setGenre(e.target.value)} />

                <label>Duration:</label>
                <input type="text" value={duration} onChange={(e) => setDuration(e.target.value)} />

                <label>Language:</label>
                <input type="text" value={language} onChange={(e) => setLanguage(e.target.value)} />

                <label>Release Date:</label>
                <input type="date" value={releaseDate} onChange={(e) => setReleaseDate(e.target.value)} />

                <label>Rating:</label>
                <input type="number" value={rating} onChange={(e) => setRating(e.target.value)} />

                <label>Theatre:</label>
                <input type="text" value={theatre} onChange={(e) => setTheatre(e.target.value)} />

                <button onClick={handleEditMovie}>Save</button>
            </div>

            {/* List of Movies */}
            <h3>Movie List</h3>
            {movies?.length > 0 ? (
                movies.map((movie, index) => (
                    <div key={index} className="movieItem">
                        <div className="info">
                            <div>üé¨ {movie?.title || "No Title Available"}</div>
                            <div>üé≠ Genre: {movie?.genre || "N/A"}</div>
                            <div>‚è≥ Duration: {movie?.duration || "N/A"}</div>
                            <div>üó£Ô∏è Language: {movie?.language || "N/A"}</div>
                            <div>üìÖ Release: {movie?.releaseDate || "N/A"}</div>
                            <div>‚≠ê Rating: {movie?.rating || "N/A"}</div>
                            <div>üè¢ Theatre: {movie?.theatre || "N/A"}</div>
                        </div>
                    </div>
                ))
            ) : (
                <p>Loading movies...</p>
            )}
        </div>
    );
};

export default EditMovie;
